tables.table_schema:
CREATE TABLE orders (
    order_id INT PRIMARY KEY,
    customer_name VARCHAR(50),
    order_date DATE,
    order_status VARCHAR(20)
);

CREATE TABLE scheduling (
    schedule_id INT PRIMARY KEY,
    order_id INT REFERENCES orders(order_id),
    printer_name VARCHAR(50),
    schedule_date DATE,
    schedule_time TIME
);

CREATE TABLE orders (
    order_id INT PRIMARY KEY,
    customer_name TEXT,
    order_date DATE,
    order_status TEXT
);

CREATE TABLE products (
    product_id INT PRIMARY KEY,
    product_name TEXT,
    price DECIMAL,
    category TEXT
);

CREATE TABLE 3d_printers (
    printer_id INT PRIMARY KEY,
    printer_name TEXT,
    printer_model TEXT,
    printer_status TEXT
);
